import axiosInstance from './axiosInstance';

export const addCourse = async (course_id, username) => {
    const response = await axiosInstance.post(`/course/addCourse`, { username });
     return response.data;
};

export const getTeacherCourse = async (teacher_id) => {
    const response = await axiosInstance.post(`/course/getTeacherCourse`,{ teacher_id });
    return response.data;
};
